void mysql_close(MYSQL *mysql) {
  pthread_mutex_lock(&mysql->lock);
  while (mysql->next_result != 0 || mysql->status != MYSQL_STATUS_READY) {
    mysql->wait_for_reconnect=1;
    pthread_cond_wait(&mysql->cond, &mysql->lock);
  }
  mysql->reconnect=0; /* ensure mysql_real_connect() is not called
                         by mysql_ping() when reconnecting */
  pthread_mutex_unlock(&mysql->lock);
  mysql_close_socket(mysql);
} 

This is a snippet of code from the MySQL C API. It shows a function to close a MySQL database connection. The use of pthread_mutex_lock and pthread_cond_wait indicate that it is using multithreading, and the function deals with database connections and sockets.
